const App = () => {
  return (
    <>
    <h1>Hello World</h1>
    <ul class="nav justify-content-center  ">
        <li class="nav-item">
            <a class="nav-link active" href="#" aria-current="page">Active link</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#">Link</a>
        </li>
        <li class="nav-item">
            <a class="nav-link disabled" href="#">Disabled link</a>
        </li>
    </ul>
    </>
  );
}

export default App;
